import classes from './Category.module.css';

export default function Category(props) {
  return (
    <div>
      <li className={classes.categoryBox}>
        <h1 className={classes.categoryName}>{props.name}</h1>
        <img className={classes.categoryImage} src={props.icons[0].url}></img>
      </li>
    </div>
  );
}
